import React from "react";
import { Link } from "react-router-dom";

import LazyImage from "../LazyImage/lazy-image.component";

const ImageItem = (element) => (
  <Link to={`/images/${element.id}`}>
    <LazyImage {...element} />
  </Link>
);

export default ImageItem;
